<template>
  <div class="schedule-warp">
    <wf-header title="我的幸运盒子" />
    <div class="schedule-title" :class="{'showHeader': $moduleConfig.isShowHeader}">
      <ul class="title-content">
        <li class="item">奖品</li>
        <li class="item">中奖时间</li>
        <li class="item">状态</li>
      </ul>
    </div>
    <ul class="schedule-content" :class="{'showHeader': $moduleConfig.isShowHeader}">
      <li class="list-warp" v-for="(item,index) in boxList" :key="index">
        <div class="item">
          <p>{{item.productName}}</p>
        </div>
        <div class="item" v-html="item.createDate"></div>
        <div class="item">
          <span class="main-class" v-if="item.status === 2"
            @click.stop="onItemAccept(item,index)">立即开启</span>
          <span v-if="item.status === 8" @click.stop="onItemAccept(item,index)">已发放</span>
        </div>
      </li>
    </ul>
    <Awards-Dialog v-model="awardDialogShow" :awards="awardInfo" :explainText="explainText"
      :bottomLink="bottomLink" @callback="confirmAwardDialog"></Awards-Dialog>
    <Modal v-model="showTip" title="温馨提示" :type="2" :closeButtonShow=false :saveButtonShow="true"
      :saveText="'知道了'" @on-save="showTip=false">
      <div class="tipContent">{{tipContent}}</div>
      <div class="tipDesc">奖品已发放至我的资产</div>
    </Modal>
  </div>
</template>
<script>
import { getBlindBox, openBlindBox } from '@/services/shop'
import AwardsDialog from '@/components/awardsDialog/awardsDialog'
export default {
  name: 'mySchedule',
  components: {
    AwardsDialog
  },
  data () {
    return {
      boxList: [],
      showTip: false,
      tipContent: '',
      awardInfo: {},
      bottomLink: {},
      explainText: {
        text: '可到我的奖品页面查看',
        color: '#bbb'
      },
      awardDialogShow: false
    }
  },
  computed: {

  },
  mounted () {
    this.updateBlindBox()
  },

  methods: {
    updateBlindBox () {
      getBlindBox().then(data => {
        this.boxList = data.data
      })
    },
    confirmAwardDialog () {
      this.awardDialogShow = false
    },
    showAwardDialog ({ awardsImage = '', awardsName = '' }) {
      this.awardInfo = {
        awardsName,
        awardsImage
      }
      this.bottomLink = {
        text: '再换一个',
        callback: () => {
          history.go(-1)
        }
      }
      this.awardDialogShow = true
    },
    onItemAccept (item, index) {
      if (item.status == 2) {
        openBlindBox(item.id).then(data => {
          if (data.code == 200) {
            this.showAwardDialog({
              awardsImage: 'data:image/png;base64,',
              awardsName: data.data.awardsName
            })
            this.updateBlindBox()
          }
        })
      }
      else if (item.status === 8) {
        this.tipContent = '您已' + item.remark
        this.showTip = true
      }
    }
  }
}
</script>
